import React, { Component } from 'react';

export default class Attendance extends Component {
  render() {
    return (
      <div className='cover'>
        <iframe title="attendance" id="form1" src="./attendance.html" width="640" height="1000" allow="autoplay"></iframe>
        </div>);
  }
}
